import React from "react";

const moveData = props => (
  <div>
    <p>{props.name}</p>
    <p>Duration: {props.duration}</p>
    <p>Energy Delta: {props.energyDelta}</p>
    <p>Base Power{props.basePower}</p>
    <p>Move Cooldown{props.moveCooldown}</p>
    <p>{props.duration}</p>
  </div>
);

export default moveData;
